const axios = require('axios');
const access_token = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjVkNTExOGYzZmJlNjI5MzE0OTc0Y2EwYiIsImlhdCI6MTU2NTU5NjAwOX0.kwgnPc0jcqGL3RBw8MOmI2eZTaRnuCqy1NmIAPsXZAY';

export default async function fetchData(URL) {
    let result={data:[], status:"INIT"}
    result.status="LOADING";
    await axios.get(URL,{
        headers: {
                 'Content-Type': 'application/json',
                 'x-access-token': access_token,
                }
        }).then(res => {
            if (!res.ok) throw Error(res.statusText)
            return res;
        })
        .then(data => {
            result.data = data;
            result.status = "SUCCESS";
            return result;
        })
        .catch(error => {
            console.log('error :', error);
            result.status="ERROR";
            return result;
        })
        return result;
}

